import React, { useEffect, useState } from 'react'

const Getapi = () => {
    const [data,setData]=useState([])
    useEffect(()=>{
        fetch("http://localhost:3000/users").then((result)=>{
            result.json().then((resp)=>{
               setData(resp)
            })
         })
    },[])
   
  return (
    <>
    <table border="1">
        <tr>
            <td>Id</td>
            <td>Name</td>
            <td>Class</td>
            <td>City</td>
        </tr>
        {
            data.map((item)=>
             <tr>
                 <td>{item.id}</td>
                 <td>{item.name}</td>
                 <td>{item.class}</td>
                 <td>{item.city}</td>
             </tr>
            )
        }
    </table>
    </>
  )
}

export default Getapi
